import Link from 'next/link';

const Navbar = (props) => {
    return(
        <div>
            <ul>
                <li>
                <Link href={{ pathname: '/dashboard', query: { keyword: 'this way' } }}><a>Dashboard</a></Link>
                </li>
            </ul>
            {props.children}
        </div>
    )
}

export default Navbar;
